import React,{Component} from "react";
import './product_list';
import axios from 'axios';
import '../scss_files/product_list_style.scss';

 class RecordList extends Component {
     constructor(props){
         super(props)

         
     }  

     

    render() { 
          
        return (
            <div>
            <button class="button-delete" role="button" >DELETE</button>
            <div className = 'box'>
        
           

                <td className = 'a'>{this.props.obj.d_sku}</td>
               
                <td className = 'a'>{this.props.obj.d_name}</td>
                
                <td className = 'a'>{this.props.obj.d_price + "$"}</td>
                
                <td className = 'a'>{this.props.obj.d_attribute}</td>
            </div>

            </div>
            
        );
    }
}

export default RecordList;

export function handleChange (e) {    ////well.
    const checked = e.target.checked;
    if(checked) {
      console.log('Checked')
    } else {
      console.log('Unchecked')
    };
  };
